import { OwpDialog, OwpMessage, OwpSession } from 'owp/wrapper';
import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import { mutate } from 'owp/api';
import * as TGEvent from 'owp/TGEvent';
import translationHelper from 'main/content/utils/translationHelper';
const pageID = 'C404000';

class DialogReweighing extends Component {
    constructor(props) {
        super(props);
        this.owpDialog = React.createRef();
        this.onDelete = this.onDelete.bind(this);
        this.onDeleteClick = this.onDelete.bind(this);
        this.state = {};
    }

    deleteDialogOpen = () => {
        if (!Boolean(this.props.MBRSEQ)) {
            OwpMessage({
                message: translationHelper(pageID + '.message.please_select_data'),
                variant: 'warning',
            });
            this.deleteDialogClose();
        } else {
            this.setState({ deleteDialogOpen: true });
        }
    };

    deleteDialogClose = () => {
        this.props.callbackHidenButton();
        this.owpDialog.handleClose();
    };

    onDelete = async (type) => {
        const data = {
            'cudtype': 'delete',
            'OWP_MBR.MBRSEQ': this.props.MBRSEQ + '', // : 로그인사용자SEQ
            // 'OWP_MBR.USERSEQ': this.props.UserSEQ,
            'OWP_MBR.FLAG': 'N',
        };

        const result = await mutate({
            url: 'deleteOwpMbr/' + this.props.MBRSEQ + '',
            data,
        }).then(res => {
            const G = TGEvent.getGridByID('OWP_C0202000');
            G.ReloadBody();
           
        }).catch(error => {
            console.error(error);
        }).finally(() => {
           
            this.deleteDialogClose();
          
        });
    };

    onDeleteClick() {
        this.onDelete('START');
    }

    render() {
        return (
            <OwpDialog
                title={null}
                dialogButton= {translationHelper(pageID +'.buttons.delete_button')}
                callbackFunction={this.deleteDialogOpen}
                dialogActions={
                    <React.Fragment>
                        <div>
                            <Button color="secondary" onClick={this.onDeleteClick}>
                            {translationHelper(pageID +'.buttons.dialog_ok_button')}
                            </Button>
                            <Button color="primary" onClick={this.deleteDialogClose}>
                            {translationHelper(pageID +'.buttons.dialog_cancel_button')}
                            </Button>
                        </div>
                    </React.Fragment>
                } innerRef={ref => this.owpDialog = ref}
                width="211px"
                height="100%"
            >
                <React.Fragment>
                    <div className="left mg0 pd0" style={{ fontSize: '14px' }}>
                    {translationHelper(pageID +'.message.do_you_want_to_delete')}
                    </div>
                </React.Fragment>
            </OwpDialog>
        );
    }
}

export default DialogReweighing;
